import React from "react";
import "./Cards.css";

function Cards(props) {
  return (
    <>
      <div className="cards">
        <div className="card">
          <img src="https://www.w3schools.com/w3css/img_avatar3.png" class="card-img-top" alt="profilePic" /> 
          {/* {props.imgsrc} */}
          {/* card_img */}
          <div className="container">
            {/* card-body */}
            <span className="card_title"><h3>{props.title}</h3></span>
            {/* "card_category" */}
            <h1 className="card_name">NAME : {props.name}</h1>
            <h2 className="card_text">CONTACT : {props.contact}</h2>
            <h2 className="card_text">LOCATION : {props.location}</h2>
            <h2 className="card_text">E-MAIL : {props.email}</h2>
            {/* card_title */}
            <a href={props.link}  >
            {/* className="btn btn-primary" */}
              {/* Go Somewhere */}
              <button className="button">Go somewhere</button>
            </a>
          </div>
        </div>
      </div>
  </>
  );
}

export default Cards;
